#include <stdio.h>
#include <stdlib.h>
#include <string.h>

int main(void) {
	char input[] = "";
	for (int i = 0; i < strlen(input) - 5; ++i) {
		int matched = 0;
		for (int x = i; x < i + 4; ++x) {
			for (int y = i; y < i + 4; ++y) {
				printf("%c %c\n", input[x], input[y]);
				if (input[x] == input[y] && x != y) {
					matched = 1;
				}
			}
			printf("\n");
		}
		if (!matched) {
			printf("Found start of packet at index: %d\n", i+4);
			return 0;
		}
		else {
			printf("Didnt find start of packet in these 4 chars\n");
		}
	}
	
	return 0;
}
